INSERT INTO `cc_pages` (`id`, `title`, `url`, `image`, `category`, `content`, `layout`, `short_description`, `meta_title`, `meta_description`, `keywords`, `sort_order`, `showTitle`, `is_delete`, `status`, `created_by`, `created_on`, `modified_by`, `modified_on`) VALUES
(10, 'Profile', 'profile123', 'pages/TzAGbNqBkUGO7CLLtsfxLLidbr0IMbYk.jpeg', NULL, '<div class="row">\r\n                <div class="col-lg-12">\r\n                    <div class="panel panel-default">\r\n                        <div class="panel-body">\r\n                            <h3>Grid options</h3>\r\n                            <p>See how aspects of the Bootstrap grid system work across multiple devices with a handy table.</p>\r\n                            <div class="table-responsive">\r\n                                <table class="table table-bordered table-striped">\r\n                                    <thead>\r\n                                        <tr>\r\n                                            <th></th>\r\n                                            <th>\r\n                                                Extra small devices\r\n                                                <small>Phones (&lt;768px)</small>\r\n                                            </th>\r\n                                            <th>\r\n                                                Small devices\r\n                                                <small>Tablets (?768px)</small>\r\n                                            </th>\r\n                                            <th>\r\n                                                Medium devices\r\n                                                <small>Desktops (?992px)</small>\r\n                                            </th>\r\n                                            <th>\r\n                                                Large devices\r\n                                                <small>Desktops (?1200px)</small>\r\n                                            </th>\r\n                                        </tr>\r\n                                    </thead>\r\n                                    <tbody>\r\n                                        <tr>\r\n                                            <th>Grid behavior</th>\r\n                                            <td>Horizontal at all times</td>\r\n                                            <td colspan="3">Collapsed to start, horizontal above breakpoints</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Max container width</th>\r\n                                            <td>None (auto)</td>\r\n                                            <td>750px</td>\r\n                                            <td>970px</td>\r\n                                            <td>1170px</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Class prefix</th>\r\n                                            <td>\r\n                                                <code>.col-xs-</code>\r\n                                            </td>\r\n                                            <td>\r\n                                                <code>.col-sm-</code>\r\n                                            </td>\r\n                                            <td>\r\n                                                <code>.col-md-</code>\r\n                                            </td>\r\n                                            <td>\r\n                                                <code>.col-lg-</code>\r\n                                            </td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th># of columns</th>\r\n                                            <td colspan="4">12</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Max column width</th>\r\n                                            <td class="text-muted">Auto</td>\r\n                                            <td>60px</td>\r\n                                            <td>78px</td>\r\n                                            <td>95px</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Gutter width</th>\r\n                                            <td colspan="4">30px (15px on each side of a column)</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Nestable</th>\r\n                                            <td colspan="4">Yes</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Offsets</th>\r\n                                            <td colspan="4">Yes</td>\r\n                                        </tr>\r\n                                        <tr>\r\n                                            <th>Column ordering</th>\r\n                                            <td colspan="4">Yes</td>\r\n                                        </tr>\r\n                                    </tbody>\r\n                                </table>\r\n                            </div>\r\n                            <p>Grid classes apply to devices with screen widths greater than or equal to the breakpoint sizes, and override grid classes targeted at smaller devices. Therefore, applying any\r\n                                <code>.col-md-</code> class to an element will not only affect its styling on medium devices but also on large devices if a\r\n                                <code>.col-lg-</code> class is not present.</p>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <!-- /.col-lg-12 -->\r\n            </div>', 1300002, 'index/adminuser/core/pages/profile123', 'Meta Title', '', 'Profile, My profile', NULL, 1, 1, 550001, 4, '2016-04-07 06:31:08', 1, '2016-04-25 07:14:19'),
(20, 'Test', 'technology', 'pages/L6q9CL6ccs0OFtxNYhySwsRff48qCFtY.jpg', 1200001, 'Test', 1300001, '', '', '', '', NULL, 0, 1, 550001, 4, '2016-04-12 13:38:13', 1, '2016-04-25 07:13:58');
